ould change to ‘2’\n\n  Scenario: Verify User can place an order without Shipping address and payment Method on file\n    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'saboor12@gmail.com' and password 'Tek@1234'\n    When User click on login button\n    And User should be logged in into Account\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on Search icon\n    And User click on item\n    And User select quantity ‘2’\n    And User click add to Cart button\n    Then the cart icon quantity should change to ‘2’\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    And User click Add a new address link for shipping address\n    And User fill new address form with below information\n      | country | fullName | phoneNumber | streetAddress | apt  | city       | state   | zipCode |\n      | Canada  | TestSab  |  6478942525 | 20 victoria   | 1702 | north york | ontario |   45257 |\n    And User click Add Your Address button\n    And User click Add a credit card or Debit Card for Payment method\n    And User fill Debit or credit card information\n      | cardNumber       | nameOnCard | expirationMonth | expirationYear | securityCode |\n      | 2153665126555415 | Tek Test   |               2 |           2027 |          145 |\n    And User click on Add your card button\n    And User click on Place Your Order\n    Then a message should be displayed ‘Order Placed, Thanks’\n\n  Scenario: Verify User can place an order with Shipping address and payment Method on file\n    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'saboor12@gmail.com' and password 'Tek@1234'\n    When User click on login button\n    And User should be logged in into Account\n    And User change the category to Electronics\n    And User search for an item 'Apex Legends'\n    And User click on Sea ge Password button\n    Then a message should be displayed ‘Password Updated Successfully’\n\n  Scenario: Verify User can add a payment method\n    When User click on Account option\n    And User click on Add a payment method link\n    And User fill Debit or credit card information\n      | cardNumber       | nameOnCard | expirationMonth | expirationYear | securityCode |\n      | 5488726485473590 | TekTest    |              05 |           2024 |          452 |\n    And User click on Add your card button\n    Then a message should be displayed ‘Payment Method added successfully’\n\n  Scenario: Verify User can edit Debit or Credit card\n    When User click on Account option\n    And User click on Edit option of card section\n    And user edit information with below data\n      | cardNumber       | nameOnCard | expirationMonth | expirationYear | securityCode |\n      | 5488726485479028 | TekCard    |              12 |           2026 |          644 |\n    And user click on Update Your Card button\n    Then a message should be displayed ‘Payment Method updated Successfully’\n\n  Scenario: Verify User can remove Debit or Credit card\n    When User click on Account option\n    And User click on remove option of card section\n    Then payment details should be removed\n\n  Scenario: Verify User can add an Address\n    When User click on Account option\n    And User click on Add address option\n    And user fill new address form with below information\n      | country | fullName | phoneNumber | streetAddress     | apt  | city       | state   | zipCode |\n      | Canada  | TekTest  |  6472543165 | 201 Van Horne Ave | 1702 | North York | Ontario |   45875 |\n    And User click Add Your Address button\n    Then a message should be displayed ‘Address Added Successfully’\n\n  Scenario: Verify User can edit an Address added on account\n    When User click on Account option\n    And User click on Account option\n    And User click on edit address option\n    And user fill new address form with below information\n      | country       | fullName | phoneNumber | streetAddress          | apt | city    | state    | zipCode |\n      | United States | NewTest  |  6478154758 | 1383 victoria park ave | 147 | Toronto | New York |   54857 |\n    And User click update Your Address button\n    Then a message should be displayed ‘Address Updated Successfully’\n\n  Scenario: Verify User can remove Address from Account\n    When User click on Account option\n    And User click on Account option\n    And User click on remove option of Address section\n    Then Address details should be removed\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailAccount.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@smokeTest","id":"144a3bae-9a09-4ab4-b7b6-932cfe30bde6"}],"language":"en","keyword":"Feature","name":"Retail Account Page","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"de4eabf8-ee0e-4dd3-b731-242ab3f908dc"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"3efddf44-0072-423b-a48b-a9417c42c256"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'saboor12@gmail.com' and password 'Tek@1234'","id":"1e7b651b-8d7b-4048-b11d-d24a90c5afa6"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"3a82ab87-24e8-47c5-9c12-2fce84982173"},{"location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User should be logged in into Account","id":"409c7d0e-dd12-4f65-bf5d-5403024110dc"}],"id":"fb4c932c-35cc-4121-82cc-a5c4f0d0e808"}},{"scenario":{"location":{"line":
